var AbstractAPRSMessage = require('./AbstractAPRSMessage.js');


function APRSMessage() {
	this.number = '';
	this.addressee = '';
	this.message = '';
	this.groupName = '';
	
	AbstractAPRSMessage.apply(this, arguments);
}

APRSMessage.prototype = new AbstractAPRSMessage();
APRSMessage.prototype.constructor = APRSMessage;

module.exports = APRSMessage;